import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import CoverPage                from './../../components/CoverPage/TitleText';
import TitleAndTextHorizontal   from './../../components/Contents/TitleAndTextHorizontal';
import TextWithImageHorizontal  from './../../components/Contents/TextWithImageHorizontal';
import CallToActionPharse       from './../../components/Contents/CallToActionPharse';

class BotStatus extends Component {
  render() {
    return (
      <div>

        <Header />

        <CoverPage
          title="Status dos Bots" />

        <div data-container-bots-list>

          <div data-header>
            <p>Nome</p>
            <p>Ultima Atualizacao</p>
            <p>Ultima Taxa</p>
            <p>Ultima Operacao</p>
            <p>Stops</p>
          </div>

          <div data-row>
            <p>AIKA</p>
            <p>27/08/2019 as 23:20</p>
            <p>1254.500</p>
            <p>27/08/2019 as 23:20</p>
            <p>OK</p>
          </div>

        </div>

        <Footer />

      </div>
    );
  }
}
export default BotStatus;
